import React from 'react';
import "./About.css"
import Jump from 'react-reveal/Jump';

function About() {
    return (
        <div className="parallax">
            <div className="about-header"><h1>About Me</h1></div>
            <Jump>
            <div className="about-text">Started from a basic hello world program in C++ to developing web apps from scratch, I really came a long way. After graduating from Institute of Technology and Science, I got placed in TCS. During the training period in Chennai I got exposed to latest technologies like Machine Learning and Deep Learning which made me fell in love with Python projects. But on the other side I always wanted to be one of the best UI developers which made me learn ReactJS and full stack on my own. You can find some of the projects under <a href="/projects">Projects</a> page.<br></br>Do follow me on social apps, links are provided under <a href="/contact">Contact</a> page.</div>
            </Jump>
        </div>
    );
}

export default About;
